de/images/image-739512-thumb-wtmy.jpg\" alt=\"Angeklickt: Fische&nbsp;duellieren&nbsp;sich im&nbsp;Pr&uuml;gelspiel&nbsp;&quot;Street Fighter&quot;\" width=\"180\" height=\"180\" border=\"0\" data-original=\"http://cdn3.spiegel.de/images/image-739512-thumb-wtmy.jpg\" /></a></div>\r\n</div>\r\n<h2 class=\"article-title\"><a title=\"Angeklickt: Fische&nbsp;duellieren&nbsp;sich im&nbsp;Pr&uuml;gelspiel&nbsp;&quot;Street Fighter&quot;\" href=\"http://www.spiegel.de/netzwelt/games/twitch-livestream-fische-spielen-per-aquarium-street-fighter-2-a-987306.html\"><span class=\"headline-intro\">Angeklickt</span> <span class=\"headline\">Fische&nbsp;duellieren&nbsp;sich im&nbsp;Pr&uuml;gelspiel&nbsp;\"Street Fighter\"</span></a></h2>\r\n<p>Aus blub, blub, blub wird b&auml;mm, b&auml;mm, b&auml;mm: Auf einem Twitch-Videokanal kann man sich ansehen, wie zwei Fische Charaktere des Pr&uuml;gelspiel-Klassikers \"Street Fighter 2\" steuern. Schwimmen sie im Aquarium herum, gehen ihre Spielfiguren aufeinander los. <span class=\"author\">Von Markus B&ouml;hm</span> <a title=\"Angeklickt: Fische&nbsp;duellieren&nbsp;sich im&nbsp;Pr&uuml;gelspiel&nbsp;&quot;Street Fighter&quot;\" href=\"http://www.spiegel.de/netzwelt/games/twitch-livestream-fische-spielen-per-aquarium-street-fighter-2-a-987306.html\">mehr...</a> <span class=\"spInteractionMarks video-forum-bracket\">[&nbsp;<a href=\"http://www.spiegel.de/netzwelt/games/twitch-livestream-fische-spielen-per-aquarium-street-fighter-2-a-987306.html#spLeserKommentare\">Forum</a>&nbsp;]</span></p>\r\n</div>'),(2,'<h1 class=\"blogTitle\"><em>Netzkultur-Guru Peter Kruse:</em><br /> &bdquo;Empathie wird zur Schl&uuml;sselkompetenz von Unternehmen&ldquo;</h1>\r\n<div class=\"blog_descr blogdescr_intro\" style=\"text-align: center;\">\r\n<p><strong>INTERVIEW:</strong> Prof. Peter Kruse wei&szlig; eins ganz sicher: Das Internet ist nicht f&uuml;r eindimensionale Werbung gemacht. Im Interview spricht er &uuml;ber die <strong>Eigendynamik des Netzes und den&nbsp;Shitstorm als Volkssport.</strong></p>\r\n</div>\r\n<p><img class=\"blog_hpic\" src=\"http://www.kircher-burkhardt.com/wp-content/themes/KB/timthumb.php?src=http://www.kircher-burkhardt.com/wp-content/uploads/2013/11/Peter-Kruse_featured.jpg&amp;w=650&amp;zc=0&amp;q=95\" alt=\"Netzkultur-Guru Peter Kruse: &bdquo;Empathie wird zur Schl&uuml;sselkompetenz von Unternehmen&ldquo;\" /></p>\r\n<h5 style=\"text-align: center;\"><a href=\"http://www.kircher-burkhardt.com/blog/web-culture-guru-peter-kruse-empathy-is-becoming-a-brands-key-component/\" target=\"_blank\">Click here for the English version of this article</a></h5>\r\n<p><strong>Herr Kruse, Sie besch&auml;ftigen sich als Wissenschaftler unter anderem mit intelligenten Netzwerken. Manche behaupten, das Internet entfache eine Art von Revolution, die in ihrem Ausma&szlig; mit der Aufkl&auml;rung verglichen werden kann. Glauben Sie das auch?</strong></p>'),(3,'<h1><a name=\"top\"></a></h1>\r\n<div class=\"bg_special\">\r\n<div class=\"container sidebarRelative\">\r\n<div id=\"head\">\r\n<div id=\"logo\" class=\"left\"><a href=\"https://www.tipico.com/de/online-sportwetten/\"><img id=\"claim\" title=\"Online Sportwetten und Live-Wetten f&uuml;r Fussball, Tennis, Basketball, Eishockey\" src=\"https://www.tipico.com/img/logo-23737C3B91FDE7922EDC1CF2EFF816F5.png\" alt=\"Online Sportwetten und Live-Wetten f&uuml;r Fussball, Tennis, Basketball, Eishockey\" width=\"160\" height=\"51\" /></a></div>\r\n<div id=\"head_main\" class=\"left\"><form id=\"topSearchForm\" action=\"/entry/landing.faces\" method=\"post\" name=\"topSearchForm\" target=\"\"></form></div>\r\n<div id=\"head_side\" class=\"right\">\r\n<div id=\"box_login\"><form id=\"loginForm\" action=\"/login\" method=\"post\">\r\n<div id=\"loginDiv\">\r\n<div class=\"box_login_sub\"><input id=\"login\" class=\"placeholder\" name=\"login\" type=\"text\" placeholder=\"Benutzername\" />\r\n<div>\r\n<div id=\"password_placeholder\">●●●●●●●●</div>\r\n<input id=\"