INSERT INTO `user_data` VALUES (1,'<p>&nbsp;</p>\r\n<p>- Lexikon <br />- Blindtexte</p>\r\n<p>- <strong>Homepagetext</strong><br />.. Umvormulieren<br />.. Absatz zur Betaversion<br />.. \"automatisches sortieren\" von www-Inhalten durch Benutzung von vitoop</p>\r\n<p>- fragmentiert<br />- dynamisch zusammengef&uuml;gte Inhalte<br />- reduktionistischer Ansatz - bei anderen Suchmaschinen gibt man irgendwas an ein an Begriffen</p>\r\n<p>&nbsp;vitoop ist eine digitale Bib. </p>\r\n<p>Entwicklung:<br />- Bei Suche ein Tag anklicken k&ouml;nnen (ist unterlegt) was in der Suche auf jeden Fall ber&uuml;cksichtigt werden muss- im Popup ein privates Textfeld als Extra-Reiter, das nur der Benutzer sieht.<br />- mindestens ein Tag zuweisen bei neuem Datensatz</p>\r\n<p>- Bereich f&uuml;r werbung einbinden / Pdf, Link ... Werbung</p>\r\n<p>&nbsp;</p>\r\n<p>Datenschutz:<br />- vitoop nicht vertrauen: tor verwenden, mehrere Acouts verwenden, Nicknamen verwenden</p>\r\n<p>- <strong>Anbieter der &ldquo;Durchleitung von Informationen&rdquo; gem&auml;&szlig; &sect; 8 (TMG)</strong></p>'),(2,'<p>Hier kannst Du Deine pers&ouml;nliche Notzen reinschreiben, die nur f&uuml;r Dich sichtbar sind.</p>'),(3,'<p>Ich bin ein Held!</p>'),(4,'<p>Hier kannst Du Deine pers&ouml;nliche Notzen reinschreiben, die nur f&uuml;r Dich sichtbar sind.</p>'),(5,'<p>Hier kannst Du Deine pers&ouml;nliche Notzen reinschreiben, die nur f&uuml;r Dich sichtbar sind.</p>');
